Vui lòng thử các bước sau:
1. Kiểm tra xem đèn hiển thị của bộ định tuyến đã kết nối thành công chưa;
2. Nếu bộ định tuyến không kết nối thành công, vui lòng kiểm tra hướng dẫn bộ định tuyến, đăng nhập vào trang cấu hình và nhập tên người dùng/mật khẩu đúng;
3. Khởi động lại bộ định tuyến;
4. Nếu vẫn không giải quyết được, vui lòng liên hệ nhà cung cấp dịch vụ.

Vui lòng thử các cách sau:
1. Bật/Tắt chế độ máy bay;
2. Khởi động lại thiết bị của bạn;
Nếu không có một trong các hoạt động trên có thể khắc phục được, vui lòng liên hệ nhà cung cấp dịch vụ địa phương của bạn.

Vui lòng thử cách sau:
1. Kiểm tra xem thiết bị có bị thiếu tiền không;
2. Thử bật/tắt chế độ máy bay;
3. Khởi động lại thiết bị;
4. Nếu tín hiệu yếu, vui lòng thử khu vực có tín hiệu tốt hơn;
5. Nếu các hoạt động trên vẫn không giải quyết được vấn đề, vui lòng liên hệ nhà cung cấp dịch vụ của bạn.
